INSERT INTO `supplements` VALUES (0,'AAKG','L-arginine alpha-ketoglutarate',1,'peak power output','strength–power','weight training',242,1,20,'A 2006 study found AAKG supplementation improved maximum effort 1-repetition bench press and Wingate peak power performance.',1,'1','100.00%','Campbell et al (2006)'),(1,'AAKG','L-arginine alpha-ketoglutarate',0,'body composition, aerobic capacity, muscle endurance','fat burning–muscle building, aerobic–endurance','weight training',242,1,20,NULL,1,'0','0.00%','Campbell et al (2006)'),(2,'Baking soda','Bicarbonate of soda, sodium bicarbonate, NaHCO3',5,'high-intensity performance','anaerobic–high-intensity','rowing, cycling, swimming, running, other',947,14,140,'Gulping down baking soda (sodium bicarbonate) makes the blood more alkaline, improving performance in lactic-acid-fueled events like the 800m sprint. Downside: a badly upset stomach.',14,'9','64.29%','Siegler et al (2010)'),(3,'BCAAs','branched-chain amino acids, leucine, isoleucine, valine',4,'fatigue resistance','aerobic–endurance','cycling, circuit training',5490,3,660,'Branched-chain amino acids',3,'3','100.00%','Greer et al (2011)'),(4,'BCAAs','branched-chain amino acids, leucine, isoleucine, valine',3,'aerobic performance, endurance, power','aerobic–endurance, strength–power','cycling, other',5490,4,660,'Branched-chain amino acids',4,'2','50.00%','Matsumoto et al (2009)'),(5,'BCAAs','branched-chain amino acids, leucine, isoleucine, valine',1,'immune defences in athletes','general fitness','running, other',5490,2,660,'Branched-chain amino acids',2,'2','100.00%','Bassit et al (2002)'),(6,'BCAAs','branched-chain amino acids, leucine, isoleucine, valine',0,'body composition','fat burning–muscle building','swimming, rowing',5490,1,660,'Branched-chain amino acids',1,'0','0.00%','Tang (2003)'),(7,'BCAAs','branched-chain amino acids, leucine, isoleucine, valine',6,'muscle damage + soreness','recovery–injury prevention','weight training, circuit training, cycling, swimmin